// part 1 - get all urls

list_url = []

window.addEventListener("wheel", g=>{
    Array.from(document.querySelectorAll('[data-index] a')).map(e=>{
        if(!list_url.includes(e.href)){
            list_url.push(e.href)
        }
    })
})

